        void radialMenuItem6_MouseUp(object sender, MouseEventArgs e)
        {
            if (this.richTextBox1.SelectedText == string.Empty)
            {
                this.radialMenuItem7.Checked = false;
                this.radialMenuItem6.Checked = true;
            }
            else
            {
                if (this.richTextBox1.SelectionFont != null)
                {
                    if (this.richTextBox1.SelectionFont.Bold)
                    {
                        this.richTextBox1.SelectionFont = new Font(this.richTextBox1.SelectionFont, (richTextBox1.SelectionFont.Style & ~(richTextBox1.SelectionFont.Style & FontStyle.Bold)));
                    }
                    else
                    {
                        this.richTextBox1.SelectionFont = new Font(this.richTextBox1.SelectionFont, this.richTextBox1.SelectionFont.Style | FontStyle.Bold);
                    }
                    this.radialMenuItem7.Checked = this.richTextBox1.SelectionFont.Bold;
                    this.radialMenuItem6.Checked = !this.richTextBox1.SelectionFont.Bold;
                }
            }
            this.radialMenu1.Refresh();
        }
        void radialMenuItem7_MouseUp(object sender, MouseEventArgs e)
        {
            if (this.richTextBox1.SelectedText == string.Empty)
            {
                this.radialMenuItem7.Checked = true;
                this.radialMenuItem6.Checked = false;
            }
            else
            {
                if (this.richTextBox1.SelectionFont != null)
                {
                    if (this.richTextBox1.SelectionFont.Bold)
                    {
                        this.richTextBox1.SelectionFont = new Font(this.richTextBox1.SelectionFont, (richTextBox1.SelectionFont.Style & ~(richTextBox1.SelectionFont.Style & FontStyle.Bold)));
                    }
                    else
                    {
                        this.richTextBox1.SelectionFont = new Font(this.richTextBox1.SelectionFont, this.richTextBox1.SelectionFont.Style | FontStyle.Bold);
                    }
                    this.radialMenuItem7.Checked = !this.richTextBox1.SelectionFont.Bold;
                    this.radialMenuItem6.Checked = this.richTextBox1.SelectionFont.Bold;
                }
            }
            this.radialMenu1.Refresh();
        }
