            {
                (sender as Syncfusion.Windows.Forms.ButtonAdv).BackColor = Color.White;
            }
            else if (sender is Syncfusion.Windows.Forms.Tools.SplitButton)
            {
                (sender as Syncfusion.Windows.Forms.Tools.SplitButton).BackColor = Color.White;
            }
        }

        void toolStripButton10_MouseDown(object sender, MouseEventArgs e)
        {
            if (sender is Syncfusion.Windows.Forms.ButtonAdv)
            {
                (sender as Syncfusion.Windows.Forms.ButtonAdv).BackColor = ControlPaint.LightLight(ColorTranslator.FromHtml("#116EDA"));
            }
            else if (sender is Syncfusion.Windows.Forms.Tools.SplitButton)
            {
                (sender as Syncfusion.Windows.Forms.Tools.SplitButton).BackColor = ControlPaint.LightLight(ColorTranslator.FromHtml("#116EDA"));
            }
        }
        void toolStripButton10_MouseLeave(object sender, System.EventArgs e)
        {
            if (sender is Syncfusion.Windows.Forms.ButtonAdv)
            {
                (sender as Syncfusion.Windows.Forms.ButtonAdv).BackColor = Color.White;
            }
            else if (sender is Syncfusion.Windows.Forms.Tools.SplitButton)
            {
                (sender as Syncfusion.Windows.Forms.Tools.SplitButton).BackColor = Color.White;
            }
        }

