        {
            if (sender is Syncfusion.Windows.Forms.ButtonAdv)
            {
                (sender as Syncfusion.Windows.Forms.ButtonAdv).BackColor = Color.FromArgb(10, Color.LightBlue); ;
            }
            else if (sender is Syncfusion.Windows.Forms.Tools.SplitButton)
            {
                (sender as Syncfusion.Windows.Forms.Tools.SplitButton).BackColor = Color.FromArgb(10, Color.LightBlue); // Color.FromArgb(100, Color.SkyBlue);
            }
        }
